public class SystemModel{
	
	private String sysId;
	private String sysCode;
	private String sysNumber;
	private String sysVersion;
	private String sysUrl;
	private String sysMemo;
	
	/**
	 * @return the sysId
	 */
	public String getSysId() {
		return sysId;
	}
	/**
	 * @param sysId the sysId to set
	 */
	public void setSysId(String sysId) {
		this.sysId = sysId;
	}
	/**
	 * @return the sysCode
	 */
	public String getSysCode() {
		return sysCode;
	}
	/**
	 * @param sysCode the sysCode to set
	 */
	public void setSysCode(String sysCode) {
		this.sysCode = sysCode;
	}
	/**
	 * @return the sysNumber
	 */
	public String getSysNumber() {
		return sysNumber;
	}
	/**
	 * @param sysNumber the sysNumber to set
	 */
	public void setSysNumber(String sysNumber) {
		this.sysNumber = sysNumber;
	}
	/**
	 * @return the sysVersion
	 */
	public String getSysVersion() {
		return sysVersion;
	}
	/**
	 * @param sysVersion the sysVersion to set
	 */
	public void setSysVersion(String sysVersion) {
		this.sysVersion = sysVersion;
	}
	/**
	 * @return the sysUrl
	 */
	public String getSysUrl() {
		return sysUrl;
	}
	/**
	 * @param sysUrl the sysUrl to set
	 */
	public void setSysUrl(String sysUrl) {
		this.sysUrl = sysUrl;
	}
	/**
	 * @return the sysMemo
	 */
	public String getSysMemo() {
		return sysMemo;
	}
	/**
	 * @param sysMemo the sysMemo to set
	 */
	public void setSysMemo(String sysMemo) {
		this.sysMemo = sysMemo;
	}

}
